import React, { Component } from 'react'
import RTChart from 'react-rt-chart';


class Chart extends Component {

    componentDidMount() {
        setInterval(() => this.forceUpdate(), 1000);
    }

    render() {
        var data = {
          date: new Date(),
          Car: getRandomValue(),
          Bus: getRandomValue()
        };
     
        return <RTChart
                fields={['Car','Bus']}
                data={data} />
    }
}
 
export default Chart
